这个代码文件本身有600多行，着重在使用 Cargo test 的部分 使用Rust游乐场的Cargo test 原代码 // ... var params = { version: "stable", optimize: "0", code: text }; if (text.indexOf("#![feature") !== -1) { params.version = "nightly"; } result_block.innerText = "Running..."; // TODO cargo test fetch_with_timeout("https://play.rust-lang.org/evaluate.json", { headers: { 'Content-Type': "application/json", }, method: 'POST', mode: 'cors', body: JSON.stringify(params) }) 修改 修改 POST的网址 修改 POST的body var params = {
// version: "stable",
// optimize: "0", code: text, channel: "stable", "mode":"debug", "backtrace":false, tests: true, crateType: "lib" }; if (text.indexOf("#![feature") !== -1) { params.version = "nightly"; } result_block.innerText = "Running..."; // TODO cargo test
// fetch_with_timeout("https://play.rust-lang.org/evaluate.json", { fetch_with_timeout("https://play.rust-lang.org/execute", { headers: { 'Content-Type': "application/json", }, method: 'POST', mode: 'cors', body: JSON.stringify(params) }) 这些是怎么知道， 主要是通过游乐场，点击Test按钮后的调试器的流量检测。 合并(用户/答案代码)与测试代码 mdBook会为哪些没有写入 fn main//... 的Rust代码，写上类似下面 + 加号的代码 + #![allow(unused_variables)] + fn main() {
#[test]
fn test_hello_world() { assert_eq!("Hello, World!", hello());
} + } 那好，我们就在 book.js 中，搞个去掉默认的函数 全局函数:移除默认的 main function remove_default_main(text){ var tArr = text.split("\n") if(tArr.slice(0,3).some(t =>t.trim() == "#![allow(unused_variables)]")){ return tArr.slice(3,-1).join("\n") } return text } 测试代码与其他(用户/答案代码),最大的不同就是 #[test] 所有，我们为测试代码，找一个全局变量 document 下的安身之所 为 document.mdBookTextCode ，book.js本身也为每个代码元素添加按钮，那正好用来检测哪个代码元素是测试代码 // Process playpen code blocks Array.from(document.querySelectorAll(".playpen")).forEach(function (pre_block) { // 添加测试代码，到全局变量document var codewithtest = playpen_text(pre_block) if(codewithtest.includes("#[test")){ // 测试代码，简单检验 document.mdBookTextCode = document.mdBookTextCode || remove_default_main(codewithtest) } 当点击运行代码的播放按钮，我们要适时加上测试代码 主要是(用户/答案代码)的播放按钮 // 播放按钮的点击事件 function run_rust_code(code_block) { var result_block = code_block.querySelector(".result"); if (!result_block) { result_block = document.createElement('code'); result_block.className = 'result hljs language-bash'; code_block.append(result_block); } let text = playpen_text(code_block); // 如 不相等和 不包括测试代码，添加测试代码上去 if(text != document.mdBookTextCode && !text.includes(document.mdBookTextCode)){ text = text + '\n' + document.mdBookTextCode }
// 说来也巧，我们的第一个修改也在这个点击事件，拼在一起看看 var params = { code: text, channel: "stable", "mode":"debug", "backtrace":false, tests: true, crateType: "lib" }; if (text.indexOf("#![feature") !== -1) { params.version = "nightly"; } result_block.innerText = "Running...";
// fetch_with_timeout("https://play.rust-lang.org/evaluate.json", { fetch_with_timeout("https://play.rust-lang.org/execute", { headers: { 'Content-Type': "application/json", }, method: 'POST', mode: 'cors', body: JSON.stringify(params) })

